const Validation = (values) => {

    let errors={};

    If(!values.fullname);{
        errors.fullname= "Oops! Name is required"
    }
    If(!values.email);{
        errors.emal= "Oops! Email is required"
    } elseif(!/\S+@\S+\.\S+/.test(values.email));{
        errors.emal="Oops! Email is invalid"
    }
    If(!values.fullname);{
        errors.tel= "Oops! Phonenumber is required"
    } elseif (values.tel.type !== Number);{
        errors.tel= "Oops! value must be numbers"
    }
  return errors;
}

export default Validation
